import { Layout, Button } from 'antd';
import 'antd/dist/antd.css';
import './style-footer.css';
import { NavLink, BrowserRouter, useHistory } from 'react-router-dom';

function Footerr(props) {
  let history = useHistory();
  const { Footer } = Layout;
  return (
    <>
      <Layout className="layout">
        <Footer style={{ textAlign: 'center' }}>
          <i className="fa fa-facebook icons" aria-hidden="true"></i>
          <i className="fa fa-twitter icons" aria-hidden="true"></i>
          <i className="fa fa-linkedin icons" aria-hidden="true"></i>

          <i className="fa fa-envelope icons" aria-hidden="true"></i>
            <p className="p1">
          <BrowserRouter>
              <Button onClick={() => history.push('/Badia')} to="/Badia">
                Home .
              </Button>
              <Button onClick={() => history.push('/Products')} to="/Products">
                Products.
              </Button>
              <Button onClick={() => history.push('/About')} to="/About">
                About .
              </Button>
              <Button onClick={() => history.push('/Contact')} to="/Contact">
                Contact Us
              </Button>
          </BrowserRouter>
            </p>
          <p className="p2">8000-150, faro, PORTUGAL</p>
          <p className="p3">Â© 2020 BADIAVENTURES</p>
        </Footer>
      </Layout>
    </>
  );
}

export default Footerr;
